import React, {useState} from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';




function Login() {
    const [email, setEmail] = useState('');
    const nav = useNavigate();

    const handleLogin = () => {
        axios
          .post('/api/login', { email })
          .then((response) => {
            console.log('Login successful:', response.data);
            navigate('/CreateOffer');
          })
          .catch((error) => {
            console.error('Login failed:', error);

          });
      };

  return (
    <>

    <div className='login-container'>
        <div className='title'>
            <h3>(Airways Fast Delivery)</h3>
        </div>

        <div className='fieldset'>
            <form>
                <fieldset>
                    <legend>Log in</legend>
                    <input type='email' value={email} onChange={(eve) => setEmail(eve.target.value)} placeholder='E-mail Address'></input>
                    <button onClick={handleLogin}>Log in</button>
                </fieldset>
                <p>if you dont have account already, then click on the link below</p>
                <p> Click on the link to <strong> <Link to = './createUser'>Create user</Link></strong></p>
            </form>

         </div>

    </div>

       </>
  )
}

export default Login
